import Layout from "../components/Layout";
import Tile from "../components/Tile";
import Image from "../images/calculator.png"

const Home = () => (
    <Layout>
        <h1>Projects</h1>
            <Tile h1="Statistics Calculator" src={Image}></Tile>
            <br></br>
            <Tile></Tile>

    </Layout>
);

export default Home;
